     console.log(task)
    });
  };
  return (
    <div className="sidebar">
      <h1>You have 20 tasks</h1>
      <h1>Let's do this!</h1>
      <hr></hr>
      <div className="TaskList">
        {allTasks}
      </div>
      <button>Add List</button>
    </div>
  );
};

export default SideBar;
